import EventosList from "./EventosList";
import { useState, useEffect } from "react";
import * as EventosServices from "../../services/eventos.services";

function Evento() {
  const [eventos, setEventos] = useState([]);

  useEffect(() => {
    EventosServices.find().then((data) => setEventos(data));
  }, []);

  return (
    <div>
      <h1>Eventos</h1>
      <ul>
        {eventos.map((evento) => (
          <EventosList key={evento._id} event={evento} />
        ))}
      </ul>
      <button type="button" className="btn btn-danger crearEvento">
        <p className="plus">+</p>
        <img className="edit" src="https://ssl.gstatic.com/bt/C3341AA7A1A076756462EE2E5CD71C11/1x/bt_compose2_1x.png"></img>
      </button>
    </div>
  );
}

export default Evento;
